`);An.addPdfSection("2024/Adam_Banham___PhD___Confirmation_of_Candidature.pdf","Adam Banham, 2022, Confirmation of Candidature Report");An.addPdfSection("2024/Adam_Banham_PhD_confirmation_presentation.pdf","Adam Banham, 2022, Confirmation of Candidature Seminar Presentation");const ci=new Sr("Research visit at RWTH Aachen","rwthVist2023");ci.addTextSection(`
